	(27, 'Artigo_Avaliador', '<p><span data-cke-bookmark="1" style="display: none;">&nbsp;</span>Certificamos que <strong>[participante_nome] </strong>participou como [funcao_nome] <em>ad hoc</em> da seleção de trabalhos da III Semana de Tecnologia da Informação (Week-IT 2017) do Instituto Federal de Educação, Ciência e Tecnologia da Bahia (IFBA) <em>Campus</em> Vitória da Conquista.<br></p>', '', NULL, NULL, '27.jpg', NULL, NULL, NULL, 'frente', '2018-02-04 23:39:27'),
	(28, 'Mostra_Robótica_Apresentador', '<p>Certificamos que o artigo intitulado <strong>[atividade_titulo] </strong>foi apresentado por <strong>[participante_nome] </strong>na Mostra de Robótica durante a III Semana de Tecnologia da Informação (Week-IT 2017) do Instituto Federal de Educação, Ciência e Tecnologia da Bahia (IFBA) <em>Campus</em> Vitória da Conquista, realizada no período de [evento_periodo].<span data-cke-bookmark="1" style="display: none;">&nbsp;</span><br></p><p><br><br></p><p><br></p>', '', NULL, NULL, '28.jpg', NULL, NULL, NULL, 'frente', '2018-02-04 23:39:27'),
	(30, 'Minicurso_Ouvinte_Monitor', '<p>Certificamos que <strong>[participante_nome] </strong>participou como [funcao_nome] do minicurso intitulado <strong>[atividade_titulo] </strong>durante a III Semana de Tecnologia da Informação (Week-IT 2017) do Instituto Federal de Educação, Ciência e Tecnologia da Bahia (IFBA) <em>Campus</em> Vitória da Conquista, realizada no período de [evento_periodo], com carga horária de [participacao_carga_horaria].<span data-cke-bookmark="1" style="display: none;">&nbsp;</span><br></p><p><br></p><p><span data-cke-bookmark="1" style="display: none;">&nbsp;</span><br></p><p><br></p>', '', NULL, NULL, '30.jpg', NULL, NULL, NULL, 'frente', '2018-02-06 13:45:32'),
